import { AiFillCaretLeft,AiFillCaretRight} from "react-icons/ai";
import {Link} from 'react-router-dom'


function Start({number,plus,miners,resetNumber}) {
  console.log(number)
  return (
    <><div className='Start'>
      <button onClick={miners} className='miners'><AiFillCaretLeft /></button>
      {number}
      <button onClick={plus} className='plus'><AiFillCaretRight /></button>
      <button onClick={resetNumber} >reset</button>
    </div>
 <Link to={'/Sadiri/Game'}><button className='game'>Start</button></Link> 
    </>
  )
}

export default Start
